import React, { Component } from 'react'
import addArticleIcon from '../create-article.svg'
import selectIcon from '../search-sign.svg'

class Menu extends Component{


	render(){

	const addI = <img src={addArticleIcon} className='icon-style'/>
	const selectI = <img src={selectIcon} className='icon-style'/>

	const menuItems = [ addI,selectI ]


	const inMenu  = menuItems.map((link, index)=>			
		<li key={index}>
			link={link}
		</li>
	)				  

	return(
		<ul>
			{inMenu}
		</ul>
	)}	

}
export default Menu
